import React from "react";
import Awesome_Github_Profile from "./Awesome_Github_Profile.PNG";

function Card() {

    const Sdata = [
        {
            id : 1,
            sname : "DARK",
            imgsrc : {Admin_Dashboard_App},
            title : "A Netflix Original Series",
            link : "https://www.netflix.com/title/80157072"
        },
        {
            id : 2,
            sname : "Stranger Things",
            imgsrc : {Awesome_Github_Profile},
            title : "A Netflix Original Series",
            link : "https://www.netflix.com/title/80057281"
        },
        {
            id : 3,
            sname : "ExtraCurricular",
            imgsrc : "https://m.media-amazon.com/images/M/MV5BNGQxMDcyOTEtZWZkNi00NzgwLWEzNjQtZmFhMGY5ZGRlMTdiXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_.jpg",
            title : "A Netflix Original Series",
            link : "https://www.netflix.com/title/80990668"
        },
        {
            id : 4,
            sname : "Stranger Things",
            imgsrc : "https://m.media-amazon.com/images/M/MV5BN2ZmYjg1YmItNWQ4OC00YWM0LWE0ZDktYThjOTZiZjhhN2Q2XkEyXkFqcGdeQXVyNjgxNTQ3Mjk@._V1_.jpg",
            title : "A Netflix Original Series",
            link : "https://www.netflix.com/title/80057281"
        },
        {
            id : 5,
            sname : "DARK",
            imgsrc : "https://wallpapercave.com/wp/wp4056410.jpg",
            title : "A Netflix Original Series",
            link : "https://www.netflix.com/title/80157072"
        },
        {
            id : 6,
            sname : "ExtraCurricular",
            imgsrc : "https://m.media-amazon.com/images/M/MV5BNGQxMDcyOTEtZWZkNi00NzgwLWEzNjQtZmFhMGY5ZGRlMTdiXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_.jpg",
            title : "A Netflix Original Series",
            link : "https://www.netflix.com/title/80990668"
        },
    ];

    return(
    <div className="cards">
        <div className="card">
            <img src={Sdata.imgsrc} alt="mypic" className="cardimg" />
            <div className="cardinfo">
                <span className="cardcategory"> {props.title} </span>
                <h3 className="cardtitle"> {props.sname} </h3>
                <a href={props.link} target="_blank">
                    <button> Watch Now </button>
                </a>
            </div>
        </div>
    </div>
    )
}

export default Card;
